template <typename UnionPtrType> AllowCSPFromHeaderValuePtr AllowCSPFromHeaderValue::Clone() const
{
    switch (tag_) {
    case Tag::kAllowStar:
        return NewAllowStar(mojo::Clone(data_.allow_star));
    case Tag::kOrigin:
        return NewOrigin(mojo::Clone(*data_.origin));
    case Tag::kErrorMessage:
        return NewErrorMessage(mojo::Clone(*data_.error_message));
    }
    return nullptr;
}

template <typename T, typename std::enable_if<std::is_same<T, AllowCSPFromHeaderValue>::value>::type*>
bool AllowCSPFromHeaderValue::Equals(const T& other) const
{
    if (tag_ != other.which())
        return false;

    switch (tag_) {
    case Tag::kAllowStar:
        return mojo::Equals(data_.allow_star, other.data_.allow_star);
    case Tag::kOrigin:
        return mojo::Equals(*(data_.origin), *(other.data_.origin));
    case Tag::kErrorMessage:
        return mojo::Equals(*(data_.error_message), *(other.data_.error_message));
    }

    return false;
}
