template <typename T, ContentSecurityPolicyHeader::EnableIfSame<T>*> bool ContentSecurityPolicyHeader::Equals(const T& other_struct) const
{
    if (!mojo::Equals(this->header_value, other_struct.header_value))
        return false;
    if (!mojo::Equals(this->type, other_struct.type))
        return false;
    if (!mojo::Equals(this->source, other_struct.source))
        return false;
    return true;
}

template <typename T, ContentSecurityPolicyHeader::EnableIfSame<T>*> bool operator<(const T& lhs, const T& rhs)
{
    if (lhs.header_value < rhs.header_value)
        return true;
    if (rhs.header_value < lhs.header_value)
        return false;
    if (lhs.type < rhs.type)
        return true;
    if (rhs.type < lhs.type)
        return false;
    if (lhs.source < rhs.source)
        return true;
    if (rhs.source < lhs.source)
        return false;
    return false;
}
